### Team ColoQuick–Cult

As Vingegaard was beginning to achieve better results in races, Danish [Continental](UCI)(UCI Continental Circuits) team [ColoQuick–Cult](Team ColoQuick) and general manager [Andersen](Christian)(Christian Andersen (cyclist)) signed a contract with him in May 2016 and he switched teams with immediate effect. In order to structure his daily life, Andersen had Vingegaard start a job at the fish factory, Chrisfish in [Hanstholm](Hanstholm). Working there during weekdays, Vingegaard skinned fish from 6am to noon before practising in the afternoons. For a time he worked with [Valgren](Michael)(Michael Valgren) at the factory, who was also pursuing a career as a professional cyclist.

In 2016, at age 19, he also accomplished his first major international result, finishing second in the UCI 2.1 level race [of China I](Tour)(Tour of China I).

In large parts of the 2017 season, Vingegaard did not take part in many races as he was sidelined with a [femur](broken)(femoral fracture) after a crash in the [Tour des Fjords](2017)(2017 Tour des Fjords). Before the injury, he finished in fourth place overall and won the youth competition in the French stage race [du Loir-et-Cher](Tour)(Tour du Loir-et-Cher).

By the time he recovered from his broken leg and the 2018 season began, he returned to strong form. On a training trip to Spain in early March 2018, Vingegaard set the time record on the test climb Coll de Rates. He cycled the 6.5 kilometers in 13.02 minutes, which was 12 seconds faster than the previous record holder [van Garderen](Tejay)(Tejay van Garderen). In the mid-2018, his physique was tested at [Danmark](Team)(Team Danmark). Afterwards, sports physiologist Lars Johansen said about Vingegaard:

